CREATE TABLE `erp_iiitk`.`Professor` ( `Name` VARCHAR(30) NOT NULL , `Branch` VARCHAR(50) NOT NULL , `Email` VARCHAR(30) NOT NULL , `Contact` VARCHAR(30) NOT NULL , `Specialization` VARCHAR(120) NOT NULL , `pic` BLOB NOT NULL ) ENGINE = InnoDB;



CREATE TABLE `erp_iiitk`.`Departments` ( `No` INT(3) NOT NULL AUTO_INCREMENT , `Name of Dept.` VARCHAR(50) NOT NULL , `Head` VARCHAR(30) NOT NULL , `Email` VARCHAR(30) NOT NULL , `No. of Students` INT(11) NOT NULL , PRIMARY KEY (`No`)) ENGINE = InnoDB;

